
var app = {
    // Application Constructor
    initialize: function() {
      document.addEventListener('deviceready', this.onDeviceReady.bind(this), false);
    },

    onDeviceReady: function() {
      this.receivedEvent('deviceready');
    },

    // Update DOM on a Received Event
    receivedEvent: function(id) {
      var height = $(window).height();
      $('#height').html(height);
      //$('#sketchImg').attr('height', (height-40));

      var width = $(window).width();
      $('#width').html(width);
      //$('#sketchImg').attr('width', width);
    },

    getSketch: function() {
      var image = document.getElementById('sketchImg');
      //var sketchBGSrc = cordova.file.applicationDirectory + "www/img/huawei_mate_fullscreen_kariert.jpg";
      //console.log('sketchBGSrc', sketchBGSrc);

      navigator.sketch.getSketch(function(imageData) {
        if(imageData == null) { return; }

        setTimeout(function() {
          if(imageData.indexOf("data:image") >= 0 ) {
            $('#sketchImg').attr('src', imageData);
          } else {
            $('#sketchImg').attr('src', "data:image/png;base64," + imageData);
          }
        }, 0);
      }, function(message) {
        setTimeout(function() {
          console.log('plugin message: ' + message);
        }, 0);
      }, {
        destinationType       : navigator.sketch.DestinationType.DATA_URL,
        encodingType          : navigator.sketch.EncodingType.JPEG,
        showColorSelect       : 1,
        showStrokeWidthSelect : 1,
        setStrokeWidth        : 8,
        //toolbarBgColor        : '#007BFF',
        //toolbarTextColor      : '#FFFFFF',
        text                  : {
          'backBtn'     : '< zurück',
          'clearBtn'    : 'löschen',
          'clearTitle'  : 'Eintrag löschen?',
          'clearText'   : 'Den gesamten Inhalt jetzt zurücksetzen?',
          'colorBtn'    : 'Textfarbe',
          'strokeBtn'   : 'Strichstärke',
          'saveBtn'     : 'Speichern'
        }/*,
        inputType           : navigator.sketch.InputType.DATA_URL,
        inputData             : 'data:image/png;base64,'
        */
      });
    }
};

app.initialize();
